import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Button } from "react-bootstrap";
import { BodyStyled } from "./Body.styled";


function LargeCard() {
  return (
  
  <BodyStyled>
    <Card style={{ width: '10rem', background: 'cornflowerblue'}}>
      {/* <Card.Img variant="top" src="holder.js/50px100" /> */}
      <Card.Body>
        <Card.Title></Card.Title>
        <Card.Text>
          Card 1.  
        </Card.Text>
        <Button variant="primary">Go</Button>
      </Card.Body>
    </Card>
  
    
    <Card style={{ width: '10rem', right }}>
      {/* <Card.Img variant="top" src="holder.js/50px100" /> */}
      <Card.Body>
        <Card.Title></Card.Title>
        <Card.Text>
          Card 2.  
        </Card.Text>
        <Button variant="primary">Go</Button>
      </Card.Body>
    </Card>
  </BodyStyled>
)
}
export default LargeCard;
